import { Route, Routes } from 'react-router-dom';
import './App.css';
import Layout from './components/Layout';
import Service from './pages/Service'


function App() {
  return (
    <div>
      <Layout>

      </Layout>

      <Routes>
        <Route path='/service' element={<Service />} />
      </Routes>
    </div>
  )
}

export default App;
